    "national-fire-plan-hazardous-fuels-reduction-program-direct-download",nt"isopen":
    false,nt"url": null,nt"notes": "This map layer portrays county level data
    for the fiscal-year-2004 National Fire Plan - Hazardous Fuels Reduction Program.
    The purpose of this program is to reduce the risk of wildland fire. Included is
    information on the number of acres treated with prescribed burns, mechanical methods,
    or other methods. Separate information is supplied for wildland/urban interface
    areas (areas where structures and other human development meet or intermingle with
    undeveloped wildland or vegetative fuels. Often incorrectly referred to as the ?interzone?
    or ?urban/wildland interface?) and for non-wildland/urban interface areas. These
    data come from the National Fire Plan Operations and Reporting System (NFPORS),
    which is used by Federal employees to plan and report activities and accomplishments
    conducted under the National Fire Plan.",nt"license_title": null,nt"extras":
